export function LogoSVG({ animate = false }: Logo, { ...rest }: Logo) {
  const id = rest.id || 'LGLogo'

  useEffect(() => {
    try {
      if (animate) {
        if (typeof animate === 'function') {
          animate(id)
        } else {
          // defaultAnimation()
          morphAnimation(id)
        }
      }
    } catch (e) {
      console.warn('Failed to animate LG logo: ', e)
    }
  })

  return <LG id="LGLogo" {...rest} />
}

